import './App.css';
import {BrowserRouter as router, Route, Switch, Router} from 'react-router-dom';
import HeaderComponent from './components/HeaderComponent'
import FooterComponent from './components/FooterComponent'
import ListDriversComponent from './components/ListDriversComponent';
import AddDriversComponent from './components/AddDriversComponent';

function App() {
  return (
    <div>
      <Router>
      <HeaderComponent />
      <div className="container">
        <Switch>
          <Route exact path="/" Component={ListDriversComponent}></Route>
          <Route path="/drivers" Component={ListDriversComponent}></Route>
          <Route path="/add-driver" Component={AddDriversComponent}></Route>
        </Switch>
      </div>
      <FooterComponent />
      </Router>
    </div>
  );
}

export default App;
